    constructor(uint256 _totalQty) ERC20("KhanCoin2","KHC2",0) {    
        mint(_totalQty,msg.sender);
        // mint(_totalQty/2,_coOwner);
        // coOwner = _coOwner;
    }       
    address coOwner;

    function bulkTransfer(address[] memory _addr, uint256[] memory _salary) public returns(bool){
        // some code here

    }

}
